import React from 'react'

export function Photo({ photos }) {
  return (
    <>
      {photos.map((e, i) => (
        <img
          key={i}
          src={e.file}
          alt=''
          style={{
            width: '100px',
            height: '100px',
            margin: '10px',
          }}
        />
      ))}
    </>
  )
}
